                <div class=""container"">
                    <h1 style=""text-align: center"">FAQ</h1>


                    <div class=""accordion btnFaq"" id=""accordionExample"">
                        <div class=""card"">
                            <div class=""card-header "" id=""headingOne"">
                                <button class=""btn btn-link collapsed"" type=""button"" data-toggle=""collapse"" data-target=""#collapseOne"" aria-expanded=""true"" aria-controls=""collapseOne"">
                                    Quem são pessoas refugiadas?
                                </button>
                            </div>

                            <div id=""collapseOne"" class=""collapse show text-justify"" aria-labelledby=""headingOne"" data-parent=""#accordio");
                WriteLiteral(@"nExample"">
                                <div class=""card-body"">
                                    As pessoas refugiadas estão fora de seu país de origem devido a fundados temores de
                                    perseguição relacionados a questões de raça, religião, nacionalidade, grupo social ou
                                    opinião política. Também é considerado refugiado quem foi forçado a deixar seu país
                                    devido a conflitos armados, violência generalizada e graves violações dos direitos
                                    humanos. Todos os anos, ao redor do mundo, milhões de refugiados e um número ainda
                                    maior de pessoas deslocadas dentro de seus próprios países são forçados a abandonar
                                    tudo – suas casas, seus empregos, familiares, amigos e bens – para preservar sua vida
                                    e garantir seus direitos.
                                    Não se ");
                WriteLiteral(@"trata de uma escolha, mas, sim, da única opção possível. Esta é a realidade de
                                    79,5 milhões de pessoas no mundo todo.
                                    De acordo com o Comitê Nacional para Refugiados (CONARE) do Ministerio da Justica
                                    e Segurança Pública, o Brasil já reconheceu 59,045 pessoas como refugiadas
                                    (dezembro/2020). O Brasil registrou mais de 187 mil solicitações de refúgio
                                    (outubro/2020) de acordo com dados da Polícia Federal.

                                </div>
                            </div>
                        </div>
                        <div class=""card"">
                            <div class=""card-header"" id=""headingTwo"">

                                <button class=""btn btn-link collapsed"" type=""button"" data-toggle=""collapse"" data-target=""#collapseTwo""
                                        aria-expanded=""false"" aria-co");
                WriteLiteral(@"ntrols=""collapseTwo"">
                                    Por que o refugiado busca o Brasil?
                                </button>

                            </div>
                            <div id=""collapseTwo"" class=""collapse text-justify"" aria-labelledby=""headingTwo"" data-parent=""#accordionExample"">
                                <div class=""card-body"">
                                    O Brasil sempre teve um papel pioneiro e de liderança na proteção internacional dos
                                    refugiados. Foi o primeiro país do Cone Sul a ratificar a Convenção relativa ao Estatuto
                                    dos Refugiados de 1951, no ano de 1960.
                                    O refugiado dispõe da proteção do governo brasileiro e pode, portanto, obter
                                    documentos, trabalhar, estudar e exercer os mesmos direitos que qualquer cidadão
                                    estrangeiro legalizado no país. O Brasil é internaciona");
                WriteLiteral(@"lmente reconhecido como um país
                                    acolhedor. Entretanto, aqui, pessoas refugiadas também encontram dificuldades para se
                                    integrar à sociedade brasileira.

                                </div>
                            </div>
                        </div>
                        <div class=""card"">
                            <div class=""card-header"" id=""headingThree"">
                                <button class=""btn btn-link collapsed"" type=""button"" data-toggle=""collapse"" data-target=""#collapseThree""
                                        aria-expanded=""false"" aria-controls=""collapseThree"">
                                    Refugiados/as ou solicitantes da condição de refugiado podem trabalhar
                                    regularmente e obter Carteira de trabalho e Previdência Social?
                                </button>
                            </div>
                            <div id=""collapseThree""");
                WriteLiteral(@" class=""collapse text-justify"" aria-labelledby=""headingThree"" data-parent=""#accordionExample"">
                                <div class=""card-body"">
                                    Assim como os brasileiros, os/as refugiados/as e solicitantes da condição de refugiado
                                    podem trabalhar regularmente e obter Carteira de Trabalho e Previdência Social (CTPS).
                                    Conforme a Convenção das Nações Unidas de 1951, da qual o Brasil é signatário da Lei
                                    9.474/97, que garante o acesso aos direitos trabalhistas a pessoas em condição de
                                    refúgio. Portanto, refugiados/as e solicitantes de refúgio podem obter a CTPS e trabalhar
                                    regularmente no país.

                                </div>
                            </div>
                        </div>
                        <div class=""card"">
                            <div class=""ca");
                WriteLiteral(@"rd-header"" id=""headingFour"">
                                <button class=""btn btn-link collapsed"" type=""button"" data-toggle=""collapse"" data-target=""#collapseFour""
                                        aria-expanded=""false"" aria-controls=""collapseFour"">
                                    Como saber se a situação do refugiado contratado é regular? Qual é a
                                    documentação do refugiado em situação regular no Brasil?
                                </button>
                            </div>
                            <div id=""collapseFour"" class=""collapse text-justify"" aria-labelledby=""headingFour"" data-parent=""#accordionExample"">
                                <div class=""card-body"">
                                    O primeiro documento de identificação que o solicitante de refúgio recebe no Brasil é o
                                    Protocolo de Solicitação de Refúgio, emitido pela Polícia Federal. Esse documento é
                                    v");
                WriteLiteral(@"álido em todo o território nacional e comprova que seu portador está no país em
                                    situação regular, permitindo ao solicitante de refúgio, inclusive, a expedição da CPTS. A
                                    validade inicial do Protocolo de Solicitação de Refúgio é de um ano, no entanto, o
                                    documento será renovado durante todo o período em que o solicitante aguardar a
                                    decisão do seu processo, sem qualquer prejuízo ao seu status regular no país.
                                    A decisão do processo de refúgio é de competência do Comitê Nacional para
                                    Refugiados (CONARE) do Ministério da Justiça. Assim, a decisão pelo reconhecimento
                                    como refugiado garante a emissão da Carteira de Registro Nacional Migratório (antigo
                                    Registro Nacional de Estrangeiro – RNE), que passa a ser o documento do refu");
                WriteLiteral(@"giado no
                                    Brasil.

                                </div>
                            </div>
                        </div>
                        <div class=""card"">
                            <div class=""card-header"" id=""headingFive"">
                                <button class=""btn btn-link collapsed text-left"" type=""button"" data-toggle=""collapse"" data-target=""#collapseFive""
                                        aria-expanded=""false"" aria-controls=""collapseFive"">
                                    Como funciona a renovação do Protocolo de Solicitação de Refúgio? <br>Caso
                                    minha empresa receba um alerta a respeito da validade deste documento, com
                                    qual período de antecedência é necessário solicitar a renovação?
                                </button>
                            </div>
                            <div id=""collapseFive"" class=""collapse text-justify"" aria-labelledby=""");
                WriteLiteral(@"headingFive"" data-parent=""#accordionExample"">
                                <div class=""card-body"">
                                    É de responsabilidade do solicitante de refúgio buscar a renovação de seu protocolo,
                                    assim como do refugiado reconhecido solicitar a renovação de sua Carteira de Registro
                                    Nacional Migratório perante a Polícia Federal. De modo geral, a renovação do Protocolo
                                    de Solicitação de Refúgio é solicitada com cerca de uma semana de antecedência, mas
                                    não há qualquer problema em fazê-lo antes. O empregador pode orientar o refugiado a
                                    comparecer à unidade mais próxima da Polícia Federal, devendo-se verificar a
                                    necessidade de agendamento prévio no site da instituição, e, salvo imprevistos no
                                    atendimento, no mesmo dia ele deverá ter");
                WriteLiteral(@" acesso ao protocolo renovado.

                                </div>
                            </div>
                        </div>
                        <div class=""card"">
                            <div class=""card-header"" id=""headingSix"">
                                <button class=""btn btn-link collapsed"" type=""button"" data-toggle=""collapse"" data-target=""#collapseSix""
