                            </div>
                            <div id=""collapseSix"" class=""collapse text-justify"" aria-labelledby=""headingSix"" data-parent=""#accordionExample"">
                                <div class=""card-body"">
                                    Sim, conforme previsto pelo Decreto no 9.199, de 20 de novembro de 2017, refugiados e
                            ");
                WriteLiteral(@"        solicitantes de refúgio podem abrir conta bancária no Brasil. Tanto o Protocolo de
                                    Solicitação de Refúgio como a Carteira de Registro Nacional Migratório são documentos
                                    hábeis para a abertura de contas bancárias. No entanto, tendo em vista o
                                    desconhecimento dos agentes bancários em relação à legislação correspondente
                                    recomenda-se que a empresa ofereça uma carta de encaminhamento para a abertura da
                                    conta, a fim de facilitar os trâmites.
                                </div>
                            </div>
                        </div>
                        <div class=""card"">
                            <div class=""card-header"" id=""headingSeven"">
                                <button class=""btn btn-link collapsed"" type=""button"" data-toggle=""collapse"" data-target=""#collapseSeven""
                           ");
                WriteLiteral(@"             aria-expanded=""false"" aria-controls=""collapseSeven"">
                                    Os refugiados e solicitantes da condição de refugiado podem ser contratados
                                    como jovens aprendizes?
                                </button>
                            </div>
                            <div id=""collapseSeven"" class=""collapse text-justify"" aria-labelledby=""headingSeven"" data-parent=""#accordionExample"">
                                <div class=""card-body"">
                                    Sim. A inclusão de pessoas refugiadas em programas de jovens aprendizes é
                                    recomendada desde que observe a legislação em vigor (Art. 428 da CLT c/c Decreto
                                    9.579/2018), que estabelece que podem ser contratados como aprendizes jovens de 14
                                    a 23 anos, sendo obrigatória a frequência escolar daqueles matriculados no ensino
                                ");
                WriteLiteral(@"    fundamental.
                                    Para saber mais sobre este tema, clique
                                    <a href=""https://56d83689-76c6-4fda-804c-f740f395bee1.usrfiles.com/ugd/56d836_49e0e11b4eb147afa5634c61ae47f248.pdf"" target=""blank"">aqui.</a>

                                </div>
                            </div>
                        </div>
                        <div class=""card"">
                            <div class=""card-header"" id=""headingEight"">
                                <button class=""btn btn-link collapsed"" type=""button"" data-toggle=""collapse"" data-target=""#collapseEight""
                                        aria-expanded=""false"" aria-controls=""collapseEight"">
                                    Como proceder caso a pessoa refugiada não possua documentos que
                                    comprovem a sua formação escolar/acadêmica?
                                </button>
                            </div>
                            <di");
                WriteLiteral(@"v id=""collapseEight"" class=""collapse text-justify"" aria-labelledby=""headingEight"" data-parent=""#accordionExample"">
                                <div class=""card-body"">
                                    Para obter a equivalência escolar de ensino médio, o refugiado deve ser orientado a
                                    procurar a Diretoria de Ensino de Escolas Estaduais da sua região de residência
                                    portando um documento de identificação pessoal, seus documentos escolares (pode ser
                                    exigida tradução) e comprovante de residência. No caso do ensino superior, o ACNUR
                                    possui um projeto de abrangência nacional que apoia o processo de revalidação de
                                    diplomas de graduação de pessoas refugiadas em parceria com a organização
                                    Compassiva, em São Paulo. Contato: revalidacao@compassiva.org.br; (11) 975120307.

                      ");
                WriteLiteral(@"          </div>
                            </div>
                        </div>
                        <div class=""card"">
                            <div class=""card-header"" id=""headingNine"">
                                <button class=""btn btn-link collapsed"" type=""button"" data-toggle=""collapse"" data-target=""#collapseNine""
                                        aria-expanded=""false"" aria-controls=""collapseNine"">
                                    Quais benefícios minha empresa terá ao contratar uma pessoa refugiada?
                                </button>
                            </div>
                            <div id=""collapseNine"" class=""collapse text-justify"" aria-labelledby=""headingNine"" data-parent=""#accordionExample"">
                                <div class=""card-body"">
                                    Contratar uma pessoa refugiada enriquece o ambiente de trabalho. São profissionais
                                    que frequentemente dominam mais de um idioma e ");
                WriteLiteral(@"possuem conhecimentos,
                                    experiências e qualificações variadas.
                                    Empresas que promovem atividades para refugiados/as relatam múltiplos benefícios,
                                    entre eles: maior engajamento de funcionários e o desenvolvimento de habilidades de
                                    liderança para os funcionários que atuam como mentores de refugiados/as. Além de
                                    trazer mais diversidade ao ambiente de trabalho, as empresas relatam que os refugiados
                                    /as contratados motivam seus colegas, demonstram alto comprometimento com suas
                                    funções e costumam ficar mais tempo em seus cargos (menores taxas de rotatividade).
                                </div>
                            </div>
                        </div>
                        <div class=""card"">
                            <div class=""card-header"" ");
                WriteLiteral(@"id=""headingTen"">
                                <button class=""btn btn-link collapsed"" type=""button"" data-toggle=""collapse"" data-target=""#collapseTen""
                                        aria-expanded=""false"" aria-controls=""collapseTen"">
                                    Ao contratar uma pessoa refugiada, minha empresa assume algum ônus ou
                                    encargo adicional?
                                </button>
                            </div>
                            <div id=""collapseTen"" class=""collapse text-justify"" aria-labelledby=""headingTen"" data-parent=""#accordionExample"">
                                <div class=""card-body"">
                                    Não. O empregador que contrata refugiados não assume nenhum ônus adicional pelo
                                    simples fato de estar contratando um refugiado.
                                </div>
                            </div>
                        </div>
                        <d");
                WriteLiteral(@"iv class=""card"">
                            <div class=""card-header "" id=""headingEleven"">
                                <button class=""btn btn-link collapsed text-left"" type=""button"" data-toggle=""collapse"" data-target=""#collapseEleven""
                                        aria-expanded=""false"" aria-controls=""collapseEleven"">
