                                    por exemplo) são o CPF e o NIS (PIS, Pasep ou NIT), isso vale para qualquer
                                    trabalhador, seja nacional ou estrangeiro. Vale destacar que, na próxima versão do
                                    eSocial, prevista para 19/07/2021, o único documento exigido será o CPF.
                                    Para mais informações acesse: <a href=""https://portal.esocial.gov.br/institucional/ambiente-de-producao-empresas/perguntas-freq
                uentes-producao-empresas-e-producao-restrita
                "">
