                            <div id=""collapseTwelve"" class=""collapse text-justify"" aria-labelledby=""headingTwelve"" data-parent=""#accordionExample"">
                                <div class=""card-body"">
                               ");
                WriteLiteral(@"     Com o objetivo de conscientizar empregadores sobre a importância de garantir o acesso
                                    ao mercado de trabalho a refugiados e migrantes, o Ministério Público do Trabalho
                                    (MPT) divulgou uma nota técnica para estimular a contratação desses trabalhadores. Na
                                    nota, o MPT orienta empresários a adotar o art. 17 da Lei 6.019/74, que regula o
                                    trabalho temporário em empresas urbanas, e que estabelece o seguinte em relação a
                                    estrangeiros: “É defeso às empresas de prestação de serviço temporário a contratação
                                    de estrangeiros com visto provisório de permanência no País”. O documento também
                                    orienta empresários a buscar informações junto a órgãos como o Ministério da Economia
                                    e as Secretarias Estaduais e Municipais de Trabalho so");
